class TestCaseBase(TestCase):
    def writeMAF(self, maf, suffix):
        """Takes one of the above MAF strings and writes it to tmp file.
        """
        tmpFile = self.getTestTempFile(suffix)
        fileHandle = open(tmpFile, 'w')
        fileHandle.write("##maf version=1\n")
        # skip first blank line
        for line in maf.split("\n")[1:]:
            fileHandle.write(line.strip() + "\n")
        fileHandle.close()
        return tmpFile

    def writeExpected(self, data, suffix):
        """write an expected file"""
        tmpFile = self.getTestTempFile(suffix)
        fileHandle = open(tmpFile, 'w')
        # skip first blank line
        for line in data.split("\n")[1:]:
            fileHandle.write(line.strip() + "\n")
        fileHandle.close()
        return tmpFile

    def compareExpectedAndRecieved(self, expected, recieved):
        """Checks two MAFs are equivalent.
        """
        system("diff -u %s %s" % (expected, recieved))

    def stdFlush(self):
        sys.stdout.flush()
        sys.stderr.flush()

    @staticmethod
    def __findCommentLine(lines, start):
        i = start
        while i < len(lines):
            if lines[i].startswith('#'):
                return i
            i += 1
        return -1

    def __parseMafComparatorOut(self, missingFile):
        """parse into two sets, the second contains the observed spontaneous bases, which
        often occur due to violating the assumptions of mafComparator"""
        with open(missingFile) as missingFh:
            lines = missingFh.readlines()
        self.assertTrue(len(lines) >= 4)
        self.assertTrue(lines[0].startswith("#"))
        self.assertTrue(lines[1].startswith("#"))
        iPart2 = self.__findCommentLine(lines, 2)
        self.assertTrue(iPart2 >= 2)
        return (lines[2:iPart2], lines[iPart2+2:])

    def mafCheckMissing(self, name, inMaf, outMaf, numSamples=100000000, allowSpontaneous=False):
        tmpMissing = self.getTestTempFile(name + ".missing")
        cmd = ["mafComparator", "--mafFile1="+inMaf, "--mafFile2="+outMaf, "--outputFile=/dev/null",
               "--sampleNumber=" + str(numSamples)]
        logger.info("run: " + " ".join(cmd))
        with open(tmpMissing, "w") as missingFh:
            exitCode = subprocess.Popen(cmd, stderr=missingFh).wait()
        if exitCode != 0:
            with open(tmpMissing, "r") as missingFh:
                sys.stderr.write(" ".join(cmd) + "\n")
                shutil.copyfileobj(missingFh, sys.stderr)
        self.assertEquals(exitCode, 0)
        # FIXME: mafComparator output changed, just ignoring for now
        # parts1, parts2 = self.__parseMafComparatorOut(tmpMissing)
        # self.assertEquals(len(parts1), 0)
        # if not allowSpontaneous:
        #     self.assertEquals(len(parts2), 0)

class MafJoinTests(TestCaseBase):
    def makeMafJoinCmd(self, guideDb, mafFileA, mafFileB, outputMafFile, treelessRoot1=None, treelessRoot2=None, maxBlkWidth=None, maxInputBlkWidth=None):
        cmd = ["mafJoin"]
        if treelessRoot1 != None:
            cmd.append("-treelessRoot1="+treelessRoot1)
        if treelessRoot2 != None:
            cmd.append("-treelessRoot2="+treelessRoot2)
        if maxBlkWidth != None:
            cmd.append("-maxBlkWidth="+str(maxBlkWidth))
        if maxInputBlkWidth != None:
            cmd.append("-maxInputBlkWidth="+str(maxInputBlkWidth))
        cmd.extend([guideDb, mafFileA, mafFileB, outputMafFile])
        return cmd

    def runMafJoin(self, guideDb, mafFileA, mafFileB, outputMafFile, expectExitCode=0, expectStderr=None, expectStderrRe=None, treelessRoot1=None, treelessRoot2=None, maxBlkWidth=None, maxInputBlkWidth=None):
        self.stdFlush()
        cmd = self.makeMafJoinCmd(guideDb, mafFileA, mafFileB, outputMafFile, treelessRoot1, treelessRoot2, maxBlkWidth, maxInputBlkWidth)
        logger.info("run: " + " ".join(cmd))
        proc = subprocess.Popen(cmd, stdout=subprocess.PIPE, stderr=subprocess.PIPE)
        (stdout, stderr) = proc.communicate()
        exitCode = proc.wait()
        if exitCode != expectExitCode:
            sys.stderr.write(stderr)
        self.assertEquals(exitCode, expectExitCode)
        self.assertEquals(stdout, "")
        if expectStderr != None:
            self.assertEquals(stderr, expectStderr)
        elif expectStderrRe != None:
            if re.search(expectStderrRe, stderr) == None:
                self.assertEquals(stderr, expectStderrRe)
        else:
            if stderr != "":
                sys.stderr.write(stderr)
                self.stdFlush()
            self.assertEquals(stderr, "")

    def mafJoinTest(self, guide, mafA, mafB, mafC, expectExitCode=0, expectStderr=None, expectStderrRe=None, treelessRoot1=None, treelessRoot2=None, maxBlkWidth=None, maxInputBlkWidth=None, runMafCheckMissing=True, mafCheckAllowSpontaneousA=False, mafCheckAllowSpontaneousB=False):
        """Writes out mafA and mafB to tmp files.
        Runs mafJoin
        Parses the output and compares it to mafC.
        specify runMafCheckMissing=False when test case violates assumptions of mafComparator
        """
        tmpFileA = self.writeMAF(mafA, "A.maf")
        tmpFileB = self.writeMAF(mafB, "B.maf")
        tmpFileC = self.writeMAF(mafC, "C.maf")
        tmpFileOutput = self.getTestTempFile("out.maf")
        self.runMafJoin(guide, tmpFileA, tmpFileB, tmpFileOutput, expectExitCode=expectExitCode, expectStderr=expectStderr, expectStderrRe=expectStderrRe, treelessRoot1=treelessRoot1, treelessRoot2=treelessRoot2, maxBlkWidth=maxBlkWidth, maxInputBlkWidth=maxInputBlkWidth)
        if expectExitCode == 0:  # only check MAF on success
            self.compareExpectedAndRecieved(tmpFileC, tmpFileOutput)
        if runMafCheckMissing and (expectExitCode == 0):
            self.mafCheckMissing("A", tmpFileA, tmpFileOutput, allowSpontaneous=mafCheckAllowSpontaneousA)
            self.mafCheckMissing("B", tmpFileB, tmpFileOutput, allowSpontaneous=mafCheckAllowSpontaneousB)

